Yes, it is a bit complicated here, because I used the recursive method.
The purpose is to get the path of the D-Bus object.

`Entity Association PDR` contains one `Container Entity` and multiple `Contained Entity`.

> std::map<EntityName, std::map<EntityName, pldm_entity>> entityAssociationMap;

The first EntityName is `Container Entity Type`, and the map inside is multiple `Contained Entity`.

Here is an example:
```
#include <iostream>
#include <map>
#include <string>

struct entity
{
    int type;
    int num;
    int con;
};

std::map<std::string, entity> objPathMap;

/* name         type
 * system       1
 * io_board     2
 * chassis      3
 * ps0          4
 * ps1          5
 * mboard       6
 * dimm0        7
 * dimm1        8
 * ps2          9
 */
static std::map<std::string, std::map<std::string, entity>>
    entityAssociationMap = {
        {"system", {{"io_board", {2, 0, 1}}, {"chassis", {3, 0, 1}}}},
        {"io_board",
         {{"ps0", {4, 0, 1}}, {"ps1", {5, 0, 1}}, {"ps2", {9, 0, 1}}}},
        {"chassis", {{"mboard", {6, 0, 1}}}},
        {"mboard", {{"dimm0", {7, 0, 1}}, {"dimm1", {8, 0, 1}}}}};

void addObjectPathEntityAssociationMap(
    const std::map<std::string, entity>& entityMaps, std::string& path)
{
    for (const auto& entity : entityMaps)
    {
        if (entityAssociationMap.find(entity.first) ==
            entityAssociationMap.end())
        {
            objPathMap.emplace(path + "/" + entity.first +
                                   std::to_string(entity.second.num),
                               entity.second);
        }
        else
        {
            std::string p =
                path + "/" + entity.first + std::to_string(entity.second.num);
            addObjectPathEntityAssociationMap(
                entityAssociationMap.at(entity.first), p);
        }
    }
}

int main()
{
    std::string path = "/xyz/openbmc_project/system";
    addObjectPathEntityAssociationMap(entityAssociationMap.at("system"), path);

    for (auto& obj : objPathMap)
    {
        std::cout << "key = " << obj.first << std::endl;
    }

    return 0;
}
```

